import { returnColFields } from '@/assets/configs/colConfig.js'


class MutationResponseData {
    constructor (responseData) {
        this.data = responseData
    }

    getBank() {
        return localStorage.getItem('bank')
    }

    deleteMetaSubstringField (client) {
        let mutationClient = {}
        for (const [key, value] of Object.entries(client)) {
            if (!key.includes('field')) {
                mutationClient[key] = value
            }
        }
        return mutationClient
    }

    mutation (client, metaFieldsArray, bank_name) {
        let mutationClient = {}
        console.log(metaFieldsArray)
        for (const [key, value] of Object.entries(client)) {
            if (metaFieldsArray.includes(key)) {
                mutationClient[key.replace(`${bank_name}_`, '')] = value
            }
        }
        return mutationClient
    }
}


class MutationBody extends MutationResponseData {
    constructor (responseData) {
        super(responseData);
        this.bodyData = this.data.data.body.body
    }

    defineFieldsSet () {
        let bank_name = this.getBank()
        let metaFieldsArray = returnColFields(bank_name)
        let resultClientsList = []
        for (let client of this.bodyData) {
            let mutationClient = {} 
            // mutationClient = this.deleteMetaSubstringField(client)
            mutationClient = this.mutation(client, bank_name, metaFieldsArray)


            resultClientsList.push(mutationClient)
        }
        console.log(resultClientsList)
    }
}


export { MutationResponseData, MutationBody };
